 genes','Number of readthrough small non coding genes'),(413,'noncoding_rcnt_l','Readthrough long non coding genes','Number of readthrough long non coding genes'),(414,'pseudogene_rcnt','Readthrough pseudogenes','Number of readthrough pseudogenes'),(415,'pseudogene_racnt','Readthrough pseudogenes','Number of readthrough pseudogenes on alternate sequences'),(416,'gencode_level','GENCODE annotation level','level 1 (verified loci), level 2 (manually annotated loci), level 3 (automatically annotated loci)'),(417,'gencode_basic','GENCODE basic annotation','GENCODE Basic is a view provided by UCSC for users. It includes a subset of the GENCODE transcripts. In general, for protein coding genes it will show only the full length models (unless a protein coding gene has no full-length models, in which case other rules apply). For noncoding genes, it will also only show the full-length (mRNA start and end found) models (unless there are no full-length models, in which case other rules apply).'),(418,'struct_var','Structural variants','Total Number of structural variants'),(419,'genblast','GenBlastG gene predictions','Number of prediction genes generated by GenBlastG'),(420,'syn_gene_pairs','Syntenic gene pairs','Syntenic gene relationship from Gramene pipeline'),(421,'vectorbase_maker_pre','VectorBase gene predictions','Number of prediction genes generated with MAKER, by VectorBase.'),(422,'trnascan','tRNAscan-SE predictions','Number of predicted tRNA genes generated by tRNAscan-SE'),(423,'tgac_pred_supp7','T. turgidum RNA-seq alignments','Number of T. turgidum RNA-seq alignments from Krasileva et al.'),(424,'tgac_pred_supp17','T. aestivum RNA-seq alignments','Number of T. aestivum RNA-seq alignments from Krasileva et al.'),(425,'genome_component','Genome Component Name','For polyploid genome, the genome component name the seq_region belongs to'),(426,'transcript_whl','RNA-seq transcripts','RNA-seq transcripts from EchinoBase'),(427,'appris','APPRIS','APPRIS is a system that deploys a range of computational methods to provide value to the annotations of the human genome. APPRIS also selects one of the CDS for each gene as the principal isoform. APPRIS defines the principal variant by combining protein structural and functional information and information from the conservation of related species. principal1 - APPRIS principal isoform. principal2 - APPRIS candidate isoform (CCDS). principal3 - APPRIS candidate isoform (earliest CCDS). principal4 - APPRIS candidate isoform (longest CCDS). principal5 - APPRIS candidate isoform (longest coding sequence). alternative1 - APPRIS candidate isoform that is conserved in at least three tested species. alternative2 - APPRIS candidate isoform that appears to be conserved in fewer than three tested species'),(428,'TSL','Transcript Support Level','Transcription Support Level (TSL) is a method to highlight the well-supported and poorly-supported transcript models for users. The method relies on the primary data that can support full-length transcript structure and data are provided by UCSC.  The following categories are assigned to each of the evaluated annotations. tsl1 - all splice junctions of the transcript are supported by at least one non-suspect mRNA. tsl2 - the best supporting mRNA is flagged as suspect or the support is from multiple ESTs. tsl3 - the only support is from a single EST. tsl4 - the best supporting EST is flagged as suspect. tsl5 - no single transcript supports the model structure. tslNA - the transcript was not analyzed for one of the following reasons: pseudogene annotation, including transcribed pseudogenes.Human leukocyte antigen (HLA) transcript. Immunoglobin gene transcript.  T-cell receptor transcript. Single-exon transcript (will be included in a future version)'),(429,'protein_coverage','Protein Coverage','Protein coverage for this gene derived from geneTree in compara'),(430,'consensus_coverage','Consensus Coverage','Consensus coverage for this gene derived from geneTree in compara'),(431,'has_start_codon','Contains start codon','Translation attribute'),(437,'lncRNACount','lncRNA_Count','Number of lncRNAs'),(438,'ncRNACount','ncRNA_Count','Number of ncRNAs'),(439,'UnclassPTCount','UnclassPT_Count','Number of Unclassified Processed Transcripts'),(444,'noncoding_cnt_m','Misc non coding genes','Number of unclassified (miscellaneous) non coding genes'),(445,'noncoding_rcnt_m','Readthrough misc non coding genes','Number of readthrough unclassified (miscellaneous) non coding genes'),(446,'noncoding_racnt_m','Readthrough misc non coding genes','Number of readthrough unclassified (miscellaneous) non coding genes on alternate sequences'),(447,'noncoding_acnt_l','Long non coding genes','Number of long non coding genes on alternate sequences'),(448,'noncoding_racnt','Readthrough non coding genes','Number of readthrough non coding genes on alternate sequences'),(449,'noncoding_rcnt','Readthrough non coding genes','Number of readthrough non coding genes'),(450,'rseq_mrna_match','RefSeq model genomic seq to mRNA match','This is a transcript attribute that signifies an exact match between the underlying genomic sequence of the RefSeq transcript with the corresponding RefSeq mRNA sequence the model was built from (based on a match between the transcript stable id and an accession in the RefSeq mRNA file). An exact match occurs when the underlying genomic sequence of the model can be perfectly aligned to the mRNA sequence post polyA clipping.'),(451,'rseq_mrna_nonmatch','RefSeq model genomic seq to mRNA non-match','This is a transcript attribute that signifies a non-match between the underlying genomic sequence of the RefSeq transcript with the corresponding RefSeq mRNA sequence the model was built from. A non-match is deemed to have occurred if the underlying genomic sequence does not have a perfect alignment to the mRNA sequence post polyA clipping. It can also signify that no comparison was possible as the model stable id may not have had a corresponding entry in the RefSeq mRNA file (sometimes happens when accessions are retired or changed). When a non-match occurs one or several of the following transcript attributes will also be present to provide more detail on the nature of the non-match: rseq_5p_mismatch, rseq_cds_mismatch, rseq_3p_mismatch, rseq_nctran_mismatch, rseq_no_comparison'),(452,'rseq_5p_mismatch','RefSeq model genomic seq (5\' UTR) to mRNA mismatch','This is a transcript attribute that signifies a mismatch between the underlying genomic sequence of the RefSeq transcript with the corresponding RefSeq mRNA sequence the model was built from. Specifically, there is a mismatch in the 5\' UTR of the RefSeq model. Information about the mismatch can be found in the value field of the transcript attribute.'),(453,'rseq_cds_mismatch','RefSeq model genomic seq (CDS) to mRNA mismatch','This is a transcript attribute that signifies a mismatch between the underlying genomic sequence of the RefSeq transcript with the corresponding RefSeq mRNA sequence the model was built from. Specifically, there is a mismatch in the CDS of the RefSeq model. Information about the mismatch can be found in the value field of the transcript attribute.'),(454,'rseq_3p_mismatch','RefSeq model genomic seq (3\' UTR) to mRNA mismatch','This is a transcript attribute that signifies a mismatch between the underlying genomic sequence of the RefSeq transcript with the corresponding RefSeq mRNA sequence the model was built from. Specifically, there is a mismatch in the 3\' UTR of the RefSeq model. Information about the mismatch can be found in the value field of the transcript attribute.'),(455,'rseq_nctran_mismatch','RefSeq model genomic seq (non-coding) to mRNA mismatch','This is a transcript attribute that signifies a mismatch between the underlying genomic sequence of the RefSeq transcript with the corresponding RefSeq mRNA sequence the model was built from. This is a comparison between the entire underlying genomic sequence of the RefSeq model to the mRNA in the case of RefSeq models that are non-coding. Information about the mismatch can be found in the value field of the transcript attribute.'),(456,'rseq_no_comparison','RefSeq model no comparison made to mRNA','This is a transcript attribute that signifies that no alignment was carried out between the underlying genomic sequence of RefSeq model and a corresponding RefSeq mRNA. The reason for this is generally that no corresponding, unversioned accession was found in the RefSeq mRNA file for the transcript stable id. This sometimes happens when accessions are retired or replaced. A second possibility is that the sequences were too long and problematic to align (though this is rare). The value field gives more information about the reason no comparison was possible.'),(457,'rseq_ens_match_wt','RefSeq model to overlapping Ensembl model whole transcript match','This is a transcript attribute that signifies that for the RefSeq transcript there is an overlapping Ensembl model that is identical across the whole transcript. A whole transcript match is defined as follows: 1) In the case that both models are coding, the transcript, CDS and peptide sequences are all identical and the genomic coordinates of every exon match. 2) In the case that both transcripts are non-coding the transcript sequences and the genomic coordinates of every exon are identical. No comparison is made between a coding and a non-coding transcript. Useful related attributes are: rseq_ens_match_cds and rseq_ens_no_match.'),(458,'rseq_ens_match_cds','RefSeq model to overlapping Ensembl model CDS match','This is a transcript attribute that signifies that for the RefSeq transcript there is an overlapping Ensembl model that is identical across the CDS region only. A CDS match is defined as follows: the CDS and peptide sequences are identical and the genomic coordinates of every translatable exon match. Useful related attributes are: rseq_ens_match_wt and rseq_ens_no_match.'),(459,'rseq_ens_no_match','RefSeq model to overlapping Ensembl model no match','This is a transcript attribute that signifies that for the RefSeq transcript there is no overlapping Ensembl model that is identical across either the whole transcript or the CDS. This is caused by differences between the transcript, CDS or peptide sequences or between the exon genomic coordinates. Useful related attributes are: rseq_ens_match_wt and rseq_ens_match_cds.'),(468,'ccds_transcript','CCDS transcript','This attribute signifies that a transcript has a matching CCDS transcript (the accession of which will be in the value column of the transcript_attrib entry). A match occurs when the genomic coordinates of all coding exons of the transcript are identical to the genomic coordinate of all coding exons in the overlapping CCDS model.'),(469,'SO_accession','SO accession','Sequence Ontology accession'),(470,'SO_term','SO term','Sequence Ontology term'),(471,'display_term','display term','Ensembl display term'),(472,'NCBI_term','NCBI term','NCBI term'),(473,'feature_SO_term','feature SO term','Sequence Ontology term for the associated feature'),(474,'rank','rank','Relative severity of this variation consequence'),(475,'polyphen_prediction','polyphen prediction','PolyPhen-2 prediction'),(476,'sift_prediction','sift prediction','SIFT prediction'),(477,'short_name','Short name','A shorter name for an instance, e.g. a VariationSet'),(478,'dbsnp_clin_sig','dbSNP/ClinVar clinical significance','The clinical significance of a variant as reported by ClinVar and dbSNP'),(479,'dgva_clin_sig','DGVa clinical significance','The clinical significance of a structural variant as reported by DGVa'),(480,'clinvar_clin_sig','ClinVar clinical significance','The clinical significance of a variant as reported by ClinVar'),(481,'prot_func_analysis','Protein function analysis ','The program used to make protein function predictions'),(482,'associated_gene','Associated gene','ID of gene(s) linked by phenotype associ