ed  by \":whole_transcript\", to indicate these RefSeq accessions have a complete sequence and structural match across the entire transcript RefSeq transcript accessions passing tests 3a,3b and 3c (but not both test 1 & 2)  will get a line in the value column consisting of all such accessions (separated by \":\") suffixed  by \":cds_only\", to indicate these RefSeq accessions have a sequence and structural match across only the CDS region.'),(511,'rna_gene_biotype','Biotype','Biotype of an RNA gene'),(512,'cmscan_truncated','Truncated','In a cmscan alignment, the end of the gene which is truncated'),(513,'cmscan_accuracy','Accuracy','The accuracy value in a cmscan alignment'),(514,'cmscan_bias','Bias','The bias value in a cmscan alignment'),(515,'cmscan_gc','GC','The GC value in a cmscan alignment'),(516,'cmscan_significant','Significant','The significant value in a cmscan alignment'),(517,'rfam_accession','Accession','Rfam accession'),(518,'broken_translation','broken translation','Transcript contains translation which contains stop codon.'),(519,'proj_parent_t','projection parent transcript','Stable identifier of the parent transcript this transcript was projected from (projection between different species and/or assemblies).'),(520,'proj_parent_g','projection parent gene','Stable identifier of the parent gene this gene was projected from (projection between different species and/or assemblies).'),(521,'MIM','MIM id','MIM id'),(522,'vectorbase_adar','VectorBase gene predictions','Number of prediction genes generated with MAKER, by VectorBase.'),(523,'_transl_start','Translation start','The start position for translation within a transcript-level seq_edit.'),(524,'_transl_end','Translation end','The end position for translation within a transcript-level seq_edit.'),(525,'submitter','submitter','A group submitting data to a major repository eg. ClinVar'),(526,'DateLastEvaluated','EvalDate','The most recent date on which evidence was evaluated and this conclusion drawn.'),(527,'submitter_id','Submitter_ID','ID for data submitter'),(528,'qtaro_category','Q-TARO Category','The phenotype \"Category of Object Character\" in the <a href=\"http://qtaro.abr.affrc.go.jp\">Q-TARO (QTL Annotation Rice Online) database</a>'),(529,'qtaro_parent_a','Q-TARO Parent A','Parent A in the <a href=\"http://qtaro.abr.affrc.go.jp\">Q-TARO (QTL Annotation Rice Online) database</a> QTL Information Table. '),(530,'qtaro_parent_b','Q-TARO Parent B','Parent B in the <a href=\"http://qtaro.abr.affrc.go.jp\">Q-TARO (QTL Annotation Rice Online) database</a> QTL Information Table. '),(531,'cadd_pred','CADD prediction','CADD prediction'),(532,'dbnsfp_revel_pred','dbNSFP REVEL prediction','dbNSFP REVEL prediction'),(533,'dbnsfp_meta_lr_pred','dbNSFP MetaLR prediction','dbNSFP MetaLR prediction'),(534,'dbnsfp_ma_pred','dbNSFP mutation assessor prediction','dbNSFP mutation assessor prediction'),(535,'MANE_Select','MANE Select v0.92','MANE Select (v0.92) is the preliminary release (phase 7) of the MANE Select data set. The Matched Annotation from NCBI and EMBL-EBI project (MANE) is a collaboration between Ensembl-GENCODE and RefSeq to select a default transcript per human protein coding locus that is representative of biology, well-supported, expressed and conserved. This transcript set matches GRCh38 and is 100% identical between RefSeq and Ensembl-GENCODE for 5\' UTR, CDS, splicing and 3\' UTR.'),(536,'Ensembl_Select','Ensembl Select','The Ensembl Select is a transcript identified by a pipeline that takes into account several criteria including transcript support (TSL), functional importance (APPRIS), representation in RefSeq and UniProt databases, length and coverage of pathogenic variants, where available.'),(537,'TAGENE_transcript','TAGENE pipeline transcript','Transcript created or extended using a model assembled from RNA-seq long reads using the TAGENE pipeline.'),(538,'legacy_biotype','Legacy biotype','Obsolete biotype previously assigned to this Ensembl