v/RefSeq/) is a curated non-redundant collection of sequences representing genomes, transcripts and proteins. The database includes 3774 organisms spanning prokaryotes, eukaryotes and viruses, and has records for 2,879,860 proteins (RefSeq release 19). RefSeq records integrate information from multiple sources, when additional data are available from those sources and therefore represent a current description of the sequence and its features. Annotations include coding regions, conserved domains, tRNAs, sequence tagged sites (STS), variation, references, gene and protein product names, and database cross-references. Sequence is reviewed and features are added using a combined approach of collaboration and other input from the scientific community, prediction, propagation from GenBank and curation by NCBI staff. The format of all RefSeq records is validated, and an increasing number of tests are being applied to evaluate the quality of sequence and annotation, especially in the context of complete genomic sequence.'),(50841,'Archive_Plants','1','XREF',0,'Ensembl Plants Archive','MISC',NULL,NULL,'Historical gene identifier linking to the Ensembl Plants Archive site.'),(50842,'Ensembl_Plants',NULL,'XREF',0,'Ensembl Plants','MISC',NULL,NULL,'Maping from translation to XREF'),(50843,'MaizeGDB',NULL,'XREF',0,'MaizeGDB','MISC',NULL,NULL,'MaizeGDB is a community-oriented, long-term, federally funded informatics service to researchers focused on the crop plant and model organism Zea mays.'),(50845,'Botrytis_community_symbol',NULL,'KNOWN',50,'Botrytis community symbol','MISC',NULL,NULL,NULL),(50846,'BARLEX',NULL,'KNOWN',1,'BARLEX: The Barley Genome Explorer ','MISC',NULL,NULL,'The <A HREF=\"http://barlex.barleysequence.org/\">barley genome explorer</A> allows a visual inspection of BAC overlaps. In addition to a graph view the user can access dotplots and fingerprints to compare two individual BACs with each other. Information to genes and markers is available as well. '),(50847,'Ngyuen_et_al_2012',NULL,'PRED',0,'PMID 23153364','MISC',NULL,NULL,'The complete swine olfactory subgenome: expansion of the olfactory gene repertoire in the pig genome. BMC Genomics201213:584 PMID: 23153364'),(50848,'Plant_Reactome_Reaction',NULL,'KNOWNXREF',0,'Plant Reactome Reaction ID','MISC',NULL,NULL,'Plant Reactome is a database of plant metabolic and regulatory pathways maintained by Gramene. This ID links to a Reaction in Plant Reactome.'),(50849,'Plant_Reactome_Pathway',NULL,'KNOWNXREF',0,'Plant Reactome Pathway ID','MISC',NULL,NULL,'Plant Reactome is a database of plant metabolic and regulatory pathways maintained by Gramene. This ID links to a Pathway in Plant Reactome.'),(50850,'CGSNL',NULL,'KNOWNXREF',0,'Committee on Gene Symbolization, Nomenclature and Linkage of the Rice Genetics Cooperative','MISC',NULL,NULL,'The Committee on Gene Symbolization, Nomenclature and Linkage (CGSNL) of the Rice Genetics Cooperative has revised the gene nomenclature system for rice (Oryza) to take advantage of the completion of the rice genome sequence and the emergence of new methods for detecting, characterizing, and describing genes in the biological community (<A HREF=\"https://doi.org/10.1007/s12284-008-9004-9\">McCouch 2008</A>).'),(50851,'Oryzabase',NULL,'KNOWNXREF',0,'Integrated Rice Science Database','MISC',NULL,NULL,'The aim of Oryzabase is to create a comprehensive view of rice (Oryza sativa) as a model monocot plant by integrating biological data with molecular genomic information (<a href=\"https://doi.org/10.1104/pp.105.063008\">Yamazaki 2006</a>).'),(50852,'RAP-DB',NULL,'KNOWNXREF',0,'Rice Annotation Project Database','MISC',NULL,NULL,'The Rice Annotation Project Database (RAP-DB) provides a comprehensive set of gene annotations for the genome sequence of rice, Oryza sativa (japonica group) cv. Nipponbare (<A HREF=\"https://dx.doi.org/10.1093%2Fpcp%2Fpcs183\">Itoh 2013</A>).'),(50853,'Gasser_lab',NULL,'KNOWNXREF',5,'Gene names assigned by Gasser Lab','M